import React from 'react';
import {
  QuestionRowWrapper,
  QuestionTitleWrapper,
} from './QuestionRow.elements';

const QuestionRow = ({ question }) => {
  return (
    <QuestionRowWrapper>
      <QuestionTitleWrapper>
        <h3>{question.question}</h3>
      </QuestionTitleWrapper>
    </QuestionRowWrapper>
  );
};

export default QuestionRow;
